import React from 'react'
import { NavLink } from 'react-router-dom'
import { LOGOUT } from '../../redux/actions/authActions'
import { connect } from 'react-redux';

function SignedIn(props) {
    return (
     <React.Fragment>
        <ul className="right">
        <a class="waves-effect waves-light btn modal-trigger" href="#modal1">Modal</a>
            <li><NavLink to="/"><i className="material-icons">collections</i></NavLink></li>
            <li><NavLink to="/"><i className="material-icons">add_a_photo</i></NavLink></li>
            <li><NavLink to="/" ><img style={{width:"40px",height:"40px",borderRadius:"40px",verticalAlign:"middle"}} src="https://avatars2.githubusercontent.com/u/51698550?s=460&u=b2a9911e8c6e6dc7f76328e3a3495a60a043b869&v=4"/></NavLink></li>
            <li><NavLink class="waves-effect waves-light" to="/login"><i onClick={()=>props.LOGOUT(props)} className="material-icons">power_settings_new</i></NavLink></li>  
        </ul> 
          <div id="modal1" class="modal">
            <div class="modal-content">
          <h4>Modal Header</h4>
          <p>A bunch of text</p>
      </div>
    </div>
     </React.Fragment>   
    )
}

const mapDispatchToProps=(dispatch)=>{
    return {
      LOGOUT:(props)=>{dispatch(LOGOUT(props))}
    }
  }

export default connect(null,mapDispatchToProps)(SignedIn);
